import React from 'react';
import styled from "styled-components";
import { Card, Tag } from "antd";

const Wrapper = styled.article`
  margin-top: 2000px;
`;

const qwerCard = styled(Card)`
  
`;

const qwerTag = styled(Tag)`

`;

const GatherCards = (props) => {
	return (
    <>
    <Wrapper>
      <img src="assets/images/gatherCardThumbnail.png" alt="thumbnail" />
      <div className="box">
        <div className="tags">
          <Tag color="#fea82f">태그</Tag>
          <Tag color="#fea82f">태그</Tag>
        </div>
        <div className="like">
          <img className="likeButton" src="assets/images/heart.png" alt="icon"/>
          <span>9,999</span>
        </div>
			</div>
    </Wrapper>

    </>
	);
};

export default GatherCards;
